import React from 'react'
import '../styles/volunteer.css'

const Volunteer = () => {
  return (
    <section className="volunteer" id="volunteer">
        <h2>Volunteer</h2>
        <h3>Join our team of our volunteers and make a change in the world.</h3>
        <p>If you are a keen admirer of nature, and are willing to work for its future, the program is for you. Mak</p>
    </section>
  )
}

export default Volunteer
